import React from "react";
import Search from "../models/Search.js"
export default class Home extends React.Component {
    
    componentDidMount(){
        fetch("http://localhost:8000/api/home").then(async response=>{
            const res = await response.json();
            this.setState(res);
        }).catch(err=>{
            console.error(err);
        });
        console.log(this.state)
    }
    render(){
        return(
            <div>
                <Search props = {this.state.data}/>
            </div>
        )
    }
}
